import "./App.css";

import Logo from "./componentes/Logo/index";


const textOption = ['Categories', 'Library','Favorites']
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo></Logo>
        <ul className="options">
          {textOption.map()}
        </ul>
      </header>
    </div>
  );
}

export default App;
